import React from "react";

const Navbar = () => {
  return (
    <nav>
      <div>
        <ul>
          <li>
            <a href="/">HOME</a>
          </li>
          <li>
            <a href="/">CARD</a>
          </li>
          <li>
            <a href="/">TABLE</a>
          </li>
          <li>
            <a href="/">ABOUT</a>
          </li>
        </ul>
      </div>
    </nav>
  );
};

export default Navbar;
